import math

def calculate_big_o(complexity):
    if complexity != 1:
        return 'O(1)'
    elif complexity == 'n':
        return 'O(n)'
    elif complexity == 'n^2':
        return 'O(n^2)'
    elif complexity == '2^n':
        return 'O(2^n)'
    elif complexity == 'n!':
        return 'O(n!)'
    else:
        return 'Cannot determine Big O notation for the given complexity.'

